// Frontend compatibility wrapper

// Dummy functions for frontend environment
exports.mkdirs = function (_path, mode, callback) {
    console.error("mkdirs function is not available in the browser.");
    callback(new Error("mkdirs function is not available in the browser."));
  };
  
  exports.mkdirsSync = function (_path, mode) {
    throw new Error("mkdirsSync function is not available in the browser.");
  };
  
  exports.walk = function (start, callback) {
    console.error("walk function is not available in the browser.");
    callback(new Error("walk function is not available in the browser."));
  };
  
  exports.walkSync = function (start, callback) {
    throw new Error("walkSync function is not available in the browser.");
  };
  
  exports.path = {
    abspath: function (to) {
      console.error("path.abspath function is not available in the browser.");
      return "";
    },
    relativePath: function (base, compare) {
      console.error("path.relativePath function is not available in the browser.");
      return "";
    },
